#include <iostream>
#include <fstream>
#include <sstream>
#include <string>
#include <vector>

int main() {
  std::string fileName, targetWord;
  std::cout << "Enter the file name: ";
  std::cin >> fileName;
  std::cout << "Enter the target word: ";
  std::cin >> targetWord;

  // Open the file
  std::ifstream file(fileName);
